import React from "react";
import {render} from "react-dom";

const Button: React.FC<{
    title: string,
    type?: 'success' | 'danger'
}> = (props) => {
    return (
        <button className={`btn btn--${props.type}`}>
            {props.title}
        </button>
    );
};

export default Button;
